const reorderList = (head) => {
  let slow = head;
  let fast = head.next;
  
  while (fast?.next) {
    slow = slow.next;
    fast = fast.next.next;
  }

  let second = slow.next;
  let prev = null;
  slow.next = null;

  while (second) {
    [second.next, prev, second] = [prev, second, second.next];
  }

  let first = head;
  second = prev;

  while (second) {
    [first.next, second.next, first, second] = [second, first.next, first.next, second.next];
  }
};

