const removeNthFromEnd = (head, n) => {
  const dummyNode = new ListNode(null, head);
  let left = dummyNode;
  let right = head;

  while (n > 0 && right) {
    right = right.next;
    n--;
  }

  while (right) {
    left = left.next;
    right = right.next;
  }

  left.next = left.next.next;
  return dummyNode.next;
};

