const isBalanced = (root) => {
  let result = true;

  const dfs = (root) => {
    if (!root) {
      return 0;
    }

    const left = dfs(root.left);
    const right = dfs(root.right);

    if (Math.abs(left - right) > 1) {
      result = false;
    }

    return 1 + Math.max(left, right);
  }

  dfs(root);

  return result;
};

